contracts/hamsterCharacterCollection.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.8;

import "@openzeppelin/contracts-upgradeable/token/ERC721/extensions/ERC721EnumerableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC721/extensions/ERC721URIStorageUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/CountersUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/security/ReentrancyGuardUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/AddressUpgradeable.sol";
import "@openzeppelin/contracts/utils/Strings.sol";

interface IHamsterMarketplace {
    function onTokenTransfer(address from, uint256 tokenId) external;
}
contract HamsterCharacterNFTs is ERC721EnumerableUpgradeable, OwnableUpgradeable, ReentrancyGuardUpgradeable  {
    uint[] private mintedNFTs;
    using CountersUpgradeable for CountersUpgradeable.Counter;
    using AddressUpgradeable for address payable;

    CountersUpgradeable.Counter public _tokenIdCounter;

     event MintNFTEvent(address indexed _to, uint indexed _tokenID);
    string public baseURI;


    address public marketplaceAddress;

    uint[] public UltraRare;
    uint256 constant public ULTRA_RARE_PRICE = 25e17;
    uint constant public MAX_ULTRARARE_SUPPLY = 1;

    uint[] public Rare;
    uint256 constant public RARE_PRICE = 125e16;
    uint constant public MAX_RARE_SUPPLY = 1;

    uint256 constant public COMMON_PRICE = 15e16;
    uint constant public     MAX_COMMON_SUPPLY = 1;

    address payable public payable_address;
    mapping(uint256 => string) private _tokenURIs;


    modifier onlyMarketplace() {
        require(msg.sender == marketplaceAddress, "Only the marketplace can call this");
        _;
    }

    function initialize(uint[] memory rareList, uint[] memory ultraRareList, string memory BaseURI, address payable payableAddress) public initializer {
        __ERC721_init("Hamster Genesis Characters", "HGC");
        __ERC721Enumerable_init();
        __Ownable_init();
        __ReentrancyGuard_init();

        require(payableAddress != address(0), "Invalid address");
        Rare = rareList;
        UltraRare = ultraRareList;
        baseURI = BaseURI;
        payable_address = payableAddress;

    }

    function setMarketplace(address _marketplaceAddress) external onlyOwner {
        marketplaceAddress = _marketplaceAddress;
    }


function _mint(address to, uint256 tokenId) internal virtual override(ERC721Upgradeable) {
    super._mint(to, tokenId);

    // Place the logic that was in _beforeTokenTransfer here:
    if (address(0) != to && marketplaceAddress != address(0)) {
        IHamsterMarketplace market = IHamsterMarketplace(marketplaceAddress);
        market.onTokenTransfer(address(0), tokenId);
    }  
}

function _transfer(address from, address to, uint256 tokenId) internal virtual override(ERC721Upgradeable) {
    super._transfer(from, to, tokenId);

    // Place the logic that was in _beforeTokenTransfer here:
    if (from != address(0) && from != to && marketplaceAddress != address(0)) {
        IHamsterMarketplace market = IHamsterMarketplace(marketplaceAddress);
        market.onTokenTransfer(from, tokenId);
    }  
}




    function mintToAddress(address to,uint id) public onlyOwner {
        require(IsValid(id),"Not a valid NFT id");
        if(IsRare(id)){
            require(TotalMinted(id) < MAX_RARE_SUPPLY , "Reached Max limit already");
            mintNewNFT(to,id);
        } else if(IsUltraRare(id)){
            require(TotalMinted(id) < MAX_ULTRARARE_SUPPLY , "Reached Max limit already");
            mintNewNFT(to,id);
        } else {
            require(TotalMinted(id) < MAX_COMMON_SUPPLY , "Reached Max limit already");
            mintNewNFT(to,id);
        }
    }


    function mintBatchToAddress(uint[] calldata ids, address to) public onlyOwner {
        for(uint i=0; i<ids.length; i++) {
            require(IsValid(ids[i]),"Not a valid NFT id");
            if(IsRare(ids[i])){
                 require(TotalMinted(ids[i]) < MAX_RARE_SUPPLY , "Reached Max limit already");
                 mintNewNFT(to,ids[i]);
             } else if(IsUltraRare(ids[i])){
                 require(TotalMinted(ids[i]) < MAX_ULTRARARE_SUPPLY , "Reached Max limit already");
                 mintNewNFT(to,ids[i]);
            } else {
                 require(TotalMinted(ids[i]) < MAX_COMMON_SUPPLY , "Reached Max limit already");
                 mintNewNFT(to,ids[i]);
            }
        }
    }
    function _setTokenURI(uint256 tokenId, string memory _tokenURI) internal virtual {
        require(_exists(tokenId), "ERC721URIStorage: URI set of nonexistent token");
        _tokenURIs[tokenId] = _tokenURI;
    }
    function mintNewNFT(address to,uint id) private {
         _tokenIdCounter.increment();
        uint256 tokenId = _tokenIdCounter.current();
        _safeMint(to, tokenId);
        _setTokenURI(tokenId, string(abi.encodePacked( Strings.toString(id),".json")));

        mintedNFTs.push(id);
        emit MintNFTEvent(to,tokenId);
    }

    function mintNFT(uint id) external payable nonReentrant {
        require(IsValid(id),"Not a valid NFT id");
        if(IsRare(id)){
            require(TotalMinted(id) < MAX_RARE_SUPPLY , "Reached Max limit already");
            require(msg.value == RARE_PRICE,"Price did not match");
            mintNewNFT(msg.sender,id);
        } else if(IsUltraRare(id)){
            require(TotalMinted(id) < MAX_ULTRARARE_SUPPLY , "Reached Max limit already");
            require(msg.value == ULTRA_RARE_PRICE,"Price did not match");
            mintNewNFT(msg.sender,id);
        } else {
            require(TotalMinted(id) < MAX_COMMON_SUPPLY , "Reached Max limit already");
            require(msg.value == COMMON_PRICE,"Price did not match");
            mintNewNFT(msg.sender,id);
        }
        payable_address.sendValue(msg.value);
    }

    function IsValid(uint id) public pure returns (bool) {
        return (id > 0 && id <= 5000);
    }

    function IsRare(uint id) public view returns (bool) {
        for(uint i=0; i<Rare.length; i++) { 
            if(Rare[i] == id) return true;
        }
        return false;
    }

    function IsUltraRare(uint id) public view returns (bool) {
        for(uint i=0; i<UltraRare.length; i++) { 
            if(UltraRare[i] == id) return true;
        }
        return false;
    }

    function TotalMinted(uint id) public view returns (uint) {
        uint count = 0;
        for(uint i=0; i<mintedNFTs.length; i++) {
            if(mintedNFTs[i] == id) count++;
        }
        return count;
    }

    function _baseURI() internal view override returns (string memory) {
        return baseURI;
    }

    function _burn(uint256 tokenId) internal override(ERC721Upgradeable) {
        super._burn(tokenId);
    }

    function tokenURI(uint256 tokenId) public view override(ERC721Upgradeable) returns (string memory) {
        return super.tokenURI(tokenId);
    }

    function transfer(address to,uint256 tokenId) external{
        _transfer(msg.sender, to, tokenId);
    }



}

contracts/hamsterMarketPlace.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts-upgradeable/token/ERC721/IERC721Upgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/AddressUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/security/ReentrancyGuardUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";

contract HamsterMarketPlaceV1 is Initializable, OwnableUpgradeable, ReentrancyGuardUpgradeable {
    using AddressUpgradeable for address payable;

    event BuyNFTEvent(address indexed collection,address indexed _from, address indexed _to,uint _tokenID, uint256 _price);
    event ListNFTEvent(address indexed collection,address indexed _from,uint _tokenID, uint256 _price);
    event EditNFTPriceEvent(address indexed collection,uint indexed _tokenID,uint256 _price);
    event DelistNFTEvent(address indexed collection , uint indexed _tokenID);
    event AddNewCollectionEvent(address indexed collection);

    address payable commissionAddress;
    uint public constant COMMISSION = 5;

    struct Log {
        address owner;
        address contractAddress;
        uint tokenID;
        uint price;
        string action;
    }

    struct NFTListing {
        address contractAddress;
        address owner;
        bool isAvailable;
        uint256 price;
        uint tokenID;
    }

    mapping(address => mapping(uint => NFTListing)) public marketPlaceListing;
    NFTListing[] private listed; 
    Log[] private history;
    address[] private validNFTContracts;

    function initialize(address[] memory _validNFTContracts, address payable _commissionAddress) public initializer {
        __Ownable_init();
        __ReentrancyGuard_init();
        require(_commissionAddress != address(0), "Invalid commission address");
        commissionAddress = _commissionAddress;
        for(uint i = 0; i < _validNFTContracts.length; i++) {
            require(_validNFTContracts[i] != address(0), "Invalid contract address");
            validNFTContracts.push(_validNFTContracts[i]);
        }
    }

     function BuyNFT(address _contractAddress,uint _tokenID) public nonReentrant payable {
               IERC721Upgradeable nft = IERC721Upgradeable(_contractAddress);
         address lastOwner = marketPlaceListing[_contractAddress][_tokenID].owner;
        require(nft.ownerOf(_tokenID) == lastOwner , "not owner any more");
        require(isValidNFTContracts(_contractAddress) , "This collection cant be sold on this marketplace");
        require(nft.getApproved(_tokenID) == address(this) , "NFT is not approved by owner");
        require(marketPlaceListing[_contractAddress][_tokenID].isAvailable , "NFT not on sale");
        require(marketPlaceListing[_contractAddress][_tokenID].price == msg.value , "You dont have enough funds to buy this NFT");

        uint myPrecious = (msg.value * COMMISSION) / 100; 
        uint ownerCommission = msg.value - myPrecious;
        payable( marketPlaceListing[_contractAddress][_tokenID].owner).sendValue(ownerCommission);
        commissionAddress.sendValue(myPrecious);
        marketPlaceListing[_contractAddress][_tokenID].isAvailable = false;
        marketPlaceListing[_contractAddress][_tokenID].owner = msg.sender;
        nft.safeTransferFrom(lastOwner,msg.sender,_tokenID);
        uint index = findIndex(_contractAddress,_tokenID);
        remove(index);
        history.push(Log(msg.sender,_contractAddress,_tokenID,msg.value,"Buy"));
        emit BuyNFTEvent(_contractAddress,lastOwner,msg.sender,_tokenID,msg.value);



    }
    function ListNFt(address _contractAddress,uint _tokenID,uint256 _price) nonReentrant public{
        require(!marketPlaceListing[_contractAddress][_tokenID].isAvailable , "This NFT is already listed");

              IERC721Upgradeable nft = IERC721Upgradeable(_contractAddress);

        require(isValidNFTContracts(_contractAddress) , "This collection cant be sold on this marketplace");
        require(nft.ownerOf(_tokenID) == msg.sender , "You are not the owner");
        require(nft.getApproved(_tokenID) == address(this) , "Please approve NFT for this contract");

        marketPlaceListing[_contractAddress][_tokenID].contractAddress = _contractAddress;
        marketPlaceListing[_contractAddress][_tokenID].isAvailable = true;
        marketPlaceListing[_contractAddress][_tokenID].owner = msg.sender;
        marketPlaceListing[_contractAddress][_tokenID].price = _price;
        marketPlaceListing[_contractAddress][_tokenID].tokenID = _tokenID;
        listed.push(marketPlaceListing[_contractAddress][_tokenID]);
        history.push(Log(msg.sender,_contractAddress,_tokenID,_price,"List"));
        emit ListNFTEvent(_contractAddress,msg.sender,_tokenID,_price);
    }

    function EditNFtPrice(address _contractAddress,uint _tokenID,uint256 _price) nonReentrant public {
                IERC721Upgradeable nft = IERC721Upgradeable(_contractAddress);
        require(isValidNFTContracts(_contractAddress) , "This collection cant be sold on this marketplace");
        require(nft.ownerOf(_tokenID) == msg.sender , "You are not the owner");
        require(nft.getApproved(_tokenID) == address(this) , "Please approve NFT for this contract");
        require(marketPlaceListing[_contractAddress][_tokenID].isAvailable , "NFT not on sale");
        marketPlaceListing[_contractAddress][_tokenID].price = _price;

        uint index = findIndex(_contractAddress,_tokenID);
        remove(index);
        listed.push(marketPlaceListing[_contractAddress][_tokenID]);
        history.push(Log(msg.sender,_contractAddress,_tokenID,_price,"Edit"));
        emit EditNFTPriceEvent(_contractAddress,_tokenID,_price);
    }

     function DelistNFT(address _contractAddress,uint _tokenID) nonReentrant public {
               IERC721Upgradeable nft = IERC721Upgradeable(_contractAddress);
        require(isValidNFTContracts(_contractAddress) , "This collection cant be sold on this marketplace");
        require(nft.ownerOf(_tokenID) == msg.sender , "You are not the owner");
        require(marketPlaceListing[_contractAddress][_tokenID].isAvailable , "NFT not on sale");
        uint index = findIndex(_contractAddress,_tokenID);
        remove(index);
        marketPlaceListing[_contractAddress][_tokenID].isAvailable = false;
        history.push(Log(msg.sender,_contractAddress,_tokenID,0,"DeList"));
        emit DelistNFTEvent(_contractAddress,_tokenID);

    }

    function isValidNFTContracts(address contractAddress) public view returns(bool){
        for(uint i=0;i<validNFTContracts.length;i++){
            if(validNFTContracts[i] == contractAddress){
                return true;
            }
        }
        return false;
    }

    function getListed() public view returns(NFTListing[] memory){
        return listed;
    }
    function getHistory() public view returns(Log[] memory){
        return history;
    }


    function remove(uint index) private{
        listed[index] = listed[listed.length - 1];
        listed.pop();
    }
    function findIndex(address _contractAddress,uint _tokenID) private view returns (uint){
        uint index = 0 ;
        for(uint i =0;i<listed.length;i++){
            if(listed[i].contractAddress == _contractAddress && listed[i].tokenID == _tokenID){
                index = i;
                break;
            }
        }
        return index;
    }
    function addNFTCollection(address _contractAddress) public onlyOwner{
        require(_contractAddress!=address(0), "Invalid address");
        require(!isValidNFTContracts(_contractAddress) , "Contract already added in list");
        validNFTContracts.push(_contractAddress);
        emit AddNewCollectionEvent(_contractAddress);
    }

    function onTokenTransfer(address from,uint256 _tokenID) external{
        IERC721Upgradeable nft = IERC721Upgradeable(msg.sender);
        require(nft.ownerOf(_tokenID) == from,"You are not the owner");
        uint index = findIndex(msg.sender,_tokenID);
        remove(index);
        marketPlaceListing[msg.sender][_tokenID].isAvailable = false;
        history.push(Log(from,msg.sender,_tokenID,0,"DeList"));
        emit DelistNFTEvent(msg.sender,_tokenID);
    }

}

